  var transitionTransform = typeTransition();
  transition.begin(element, [[transitionTransform, "translateX(-" + positionBefore + "px)", "translateX(-" + positionAfter + "px)", "0.20s", "ease-out"]], {
    onBeforeChangeStyle: function onBeforeChangeStyle() {
      moveElement = false;
    },
    onAfterChangeStyle: function onAfterChangeStyle() {
      SpatialNavigation.pause();
    },
    onTransitionEnd: function onTransitionEnd(finished) {
      if (!finished || stop) return;
      SpatialNavigation.resume();
      moveElement = true;
    }
  });
