  hlsLiveTv.stopLoad();
  fadeOutElement('videoEnVivo', '1', '0', '0.1s');
  fadeOutElement(idPreviewPosterEnVivo, '1', '0', '0s');
  fadeOutElement(errorNetworkChannel, '1', '0', '0s');
