document.getElementById('video-alacarta').addEventListener('keydown', function (event) {
  switch (event.keyCode) {
    case 415:
      playPlayer(13);
      $('#button-play').focus();
      break;

    case 19:
      pausePlayer(13);
      $('#button-pause').focus();
      break;

    case 412:
      rewindPlayer(13);
      $('#button-rewind').focus();
      break;

    case 417:
      forwardPlayer(13);
      $('#button-forward').focus();
      break;

    case 10252:
      if (playingVideo) {
        pausePlayer(13);
        $('#button-pause').focus();
        break;
      } else {
        playPlayer(13);
        $('#button-play').focus();
        break;
      }

    case 10232:
      rewindPlayer(13);
      $('#button-rewind').focus();
      break;

    case 10233:
      forwardPlayer(13);
      $('#button-forward').focus();
      break;
  }
});
